				let array_payload_products=[];		
				let array_payload_group=[];			
				let APIdata = [];					
				let arrayconstraints = [];
				let tmpjson = {};
				APIdata = GetGSheetContent_EditLPC.data.values;
				if (APIdata.length==3){
					showAlert('No data to load')
				}
				else{
					array_payload_group = {
							"start": ((APIdata[3][5]==null||APIdata[3][5]=="")?null:APIdata[3][5]), 
							"end": ((APIdata[3][6]==null||APIdata[3][6]=="")?null:APIdata[3][6]), 
							"minDwt": ((APIdata[3][7]==null||APIdata[3][7]=="")?null:APIdata[3][7]), 
							"maxDwt": ((APIdata[3][8]==null||APIdata[3][8]=="")?null:APIdata[3][8]),
							"minCapacity": ((APIdata[3][9]==null||APIdata[3][9]=="")?null:APIdata[3][9]),
							"maxCapacity": ((APIdata[3][10]==null||APIdata[3][10]=="")?null:APIdata[3][10])
						};					
					let j=0;
					let curType = "";
					let i=3;
					for (let i=3;i<APIdata.length;i++){
							if (APIdata[i][11] != null && APIdata[i][11] !="") {
									tmpjson = {
										"id":  APIdata[i][11],
										"productId": APIdata[i][12]
									}
									if (APIdata[i][13]!=null&&APIdata[i][13]!=""){
										tmpjson.ratio = APIdata[i][13]
									}
									if (APIdata[i][14]!=null&&APIdata[i][14]!=""){
										tmpjson.parcelMin = {"metric":APIdata[i][14], "unit": APIdata[i][15]}
									}
									if (APIdata[i][16]!=null&&APIdata[i][16]!=""){
										tmpjson.parcelMax = {"metric":APIdata[i][16], "unit": APIdata[i][17]}
									}
									if (APIdata[i][18]!=null&&APIdata[i][18]!=""){
										tmpjson.parcelNominal = {"metric":APIdata[i][18], "unit": APIdata[i][19]}
									}
									if (APIdata[i][20]!=null&&APIdata[i][20]!=""){
										tmpjson.parcelTolerance = APIdata[i][20]
									}

									array_payload_products.push(tmpjson);
							}
							else{
								break;
							}
					}

					array_payload.push({
							"type": APIdata[3][0],	
							"source": ((APIdata[3][1]==null||APIdata[3][1]=="")?null:({"locationId": APIdata[3][1],"type": APIdata[3][2]})), 
							"destination": ((APIdata[3][3]==null||APIdata[3][3]=="")?null:({"locationId": APIdata[3][3],"type": APIdata[3][4]})), 
							"start": ((APIdata[3][5]==null||APIdata[3][5]=="")?null:APIdata[3][5]), 
							"end": ((APIdata[3][6]==null||APIdata[3][6]=="")?null:APIdata[3][6]), 
							"minDwt": ((APIdata[3][7]==null||APIdata[3][7]=="")?null:APIdata[3][7]), 
							"maxDwt": ((APIdata[3][8]==null||APIdata[3][8]=="")?null:APIdata[3][8]),
							"minCapacity": ((APIdata[3][9]==null||APIdata[3][9]=="")?null:APIdata[3][9]),
							"maxCapacity": ((APIdata[3][10]==null||APIdata[3][10]=="")?null:APIdata[3][10]),
							"productConstraints": array_payload_products
					});

					storeValue("key_EditLPC_payload", array_payload);
					storeValue("key_EditLPC_payloadGroup", array_payload_group);
					storeValue("key_EditLPC_payloadProduct", array_payload_products);
				}
			},
			//fail
			() => {showAlert("Something went wrong - can't load data");}			
		)
	}

